import React from 'react';
import Header from "../components/Header";
import Footer from "../components/Footer";

const SubmitPage = () => {
    return (
        <main className='submit_page_container'>
            <Header/>
            <div>
                <h2 className='login_header'>You are Logged in RPC!</h2>
                <img src={'/style/check-mark-icon.png'} alt="check" className="checkMark"/>
            </div>
            <Footer/>
        </main>
    );
};

export default SubmitPage;
